import React from "react";
import "./UploadIcon.css";

const UploadIcon = () => {
  return (
    <div class="wrapper">
      <div class="file-upload">
        <input type="file" />
        <i class="fa fa-arrow-up" style={{'fontSize':''}}></i>
      </div>
    </div>
  );
};

export default UploadIcon;
